INSERT INTO `dictionary_words_ash` (`unique_no`, `word`, `meaning`, `related_photo`, `level_of_user`) VALUES
(1,	'Collective drift of whales',	'The phenomena of going group of Whales out to the beach then they die.',	NULL,	NULL),
(2,	'Ultraviolet',	'Ultraviolet is a light that has a wavelength that is after the violet (= light purple) end of the range of colors that can be seen by humans. Light of this type causes the skin to become darker in the sun',	NULL,	NULL),
(3,	'Algae',	'A group of photosynthetic organisms that in general possess pigments such as chlorophyll but lack true roots, stems and leaves characteristic of terrestrial plants',	NULL,	NULL),
(4,	'Oil spill',	'An accidental release of oil into a body of water, as from a tanker, offshore drilling rig, or underwater pipeline, often presenting a hazard to marine life and the environment',	NULL,	NULL),
(5,	'Shark',	'a large fish that has sharp teeth and a pointed fin on its back',	NULL,	NULL),
(6,	'Whale',	'a very large sea mammal that breathes air through a hole at the top of its head.',	NULL,	NULL),
(7,	'Skin cancer',	'Cancer that forms in the tissues of the skin',	NULL,	NULL),
(9,	'Sun protection factor',	'Sun Protection Factor is a measure of how well a sunscreen will protect skin from UVB rays, the kind of radiation that causes sunburn, damages skin, and can contribute to skin cancer.',	NULL,	NULL),
(10,	'Coastal zone',	'The part of the land surface influenced by marine processes. It extends from the landward limit of tides, waves, and windblown coastal dunes, and seaward to the point at which waves interact significantly with the sea bed. The coastal zone is a dynamic part of the Earth\'s surface where both marine and atmospheric processes produce rocky coasts, as well as beaches and dunes, barriers and tidal inlets, and shape deltas.',	NULL,	NULL),
(11,	'Sea waves',	'Sea waves phenomena generated by wind blowing over the ocean surface. The stronger the wind, the longer it blows and the longer the fetch, or stretch of ocean over which it blows.',	NULL,	NULL),
(12,	'Tides and tidal currents',	'Tide is a phenomenon which is produced by the gravitational pull of the Moon and Sun acting on a rotating Earth. This pull produces a very slight bulge in the ocean, which we know as tide. The tides and the currents they generate are responsible for about 50% of the marine energy delivered to the coast. The major impact of tides is to shift the shoreline between high and low tide, and to generate tidal currents either parallel to the coast, or at tidal inlets and estuaries, currents flowing into the inlets and perpendicular to the coast.',	NULL,	NULL),
(13,	'beach',	'Beaches are wave-deposited accumulations of sediment located at the shoreline. They require a base to reside on, usually the bedrock geology, waves to shape them, sediment to form them, and most are also affected by tides. The beach extends from wave base where waves begin to feel bottom and shoal, across the near shore zone, though the surf zone to the upper limit of wave swash.',	NULL,	NULL),
(14,	'Accretion',	'The accumulation of (beach) SEDIMENT, which is deposited by natural fluid flow processes.',	NULL,	NULL),
(15,	'Breaker zone',	'The zone within which WAVES approaching the COASTLINE commence breaking, typically in WATER DEPTHS of between 5 m and 10 m.',	NULL,	NULL),
(16,	'Contour current',	'A bottom current that flows parallel to the slopes of the continental margin (along the contour rather than down the SLOPE).',	NULL,	NULL),
(17,	'Current meter',	'An instrument for measuring the velocity of a CURRENT. It is traditionally operated by a wheel equipped with vanes of cups which is rotated by the action of the impinging CURRENT. A recording device is provided to indicate the speed of rotation which is correlated with the velocity of the CURRENT',	NULL,	NULL),
(18,	'Lagoon',	'Shallow expanse of seawater separated from the sea by a ridge of sand or a barrier island.',	NULL,	NULL),
(19,	'Ocean currents',	'Oceanic currents describe the movement of water from one location to another. Currents are generally measured in meters per second',	NULL,	NULL),
(20,	'Steaming black sea',	'Called as the ‘sea smoke’, the steam arising out of the Black Sea is caused due the humidity of the oceanic water counteracting with the coolness of the wind over the water’s surface.',	NULL,	NULL);
