INSERT INTO `uv_index` (`unique_no`, `uv_index_status`, `from_d`, `to_d`, `Recommendations`, `skin_white_burners`, `skin_naturally_black`, `skin_white_tanners`, `skin_naturally_brown`) VALUES
(16,	'Low',	0,	2,	'A UV Index reading of 0 to 2 means low danger from the sun\'s UV rays for the average person.\n  Wear sunglasses on bright days.\n If you burn easily, cover up and use broad spectrum SPF 30+ sunscreen.\n Watch out for bright surfaces, like sand, water and snow, which reflect UV and increase exposure.',	'Low',	'No risk',	'No risk',	'No risk'),
(17,	'Moderate',	3,	5,	'A UV Index reading of 3 to 5 means moderate risk of harm from unprotected sun exposure.\n Stay in shade near midday when the sun is strongest.\n If outdoors, wear protective clothing, a wide-brimmed hat, and UV-blocking sunglasses.\n Generously apply broad spectrum SPF 30+ sunscreen every 2 hours, even on cloudy days, and after swimming or sweating. \n Watch out for bright surfaces, like sand, water and snow, which reflect UV and increase exposure.',	'Low',	'Low',	'No risk',	'No risk'),
(18,	'High',	6,	7,	'A UV Index reading of 6 to 7 means high risk of harm from unprotected sun exposure. Protection against skin and eye damage is needed.\n Reduce time in the sun between 10 a.m. and 4 p.m.\n If outdoors, seek shade and wear protective clothing, a wide-brimmed hat, and UV-blocking sunglasses.\n Generously apply broad spectrum SPF 30+ sunscreen every 2 hours, even on cloudy days, and after swimming or sweating. \n Watch out for bright surfaces, like sand, water and snow, which reflect UV and increase exposure.',	'Medium',	'Medium',	'Low',	'Medium'),
(19,	'Very high',	8,	9,	'A UV Index reading of 8 to 10 means very high risk of harm from unprotected sun exposure. Take extra precautions because unprotected skin and eyes will be damaged and can burn quickly.\n Minimize sun exposure between 10 a.m. and 4 p.m.\n If outdoors, seek shade and wear protective clothing, a wide-brimmed hat, and UV-blocking sunglasses.\n Generously apply broad spectrum SPF 30+ sunscreen every 2 hours, even on cloudy days, and after swimming or sweating. \n Watch out for bright surfaces, like sand, water and snow, which reflect UV and increase exposure.',	'High',	'High',	'Medium',	'Medium'),
(20,	'Extreme',	11,	100000,	'A UV Index reading of 11 or more means extreme risk of harm from unprotected sun exposure. Take all precautions because unprotected skin and eyes can burn in minutes. \n Try to avoid sun exposure between 10 a.m. and 4 p.m.\n If outdoors, seek shade and wear protective clothing, a wide-brimmed hat, and UV-blocking sunglasses.\n Generously apply broad spectrum SPF 30+ sunscreen every 2 hours, even on cloudy days, and after swimming or sweating.\n Watch out for bright surfaces, like sand, water and snow, which reflect UV and increase exposure.',	'Very high',	'High',	'High',	'High');
