(1,	1,	'2017-04-25 08:39:20',	'2017-04-25 08:39:20',	'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!',	'Hello world!',	'',	'publish',	'open',	'open',	'',	'hello-world',	'',	'',	'2017-04-25 08:39:20',	'2017-04-25 08:39:20',	'',	0,	'http://localhost:51791/?p=1',	0,	'post',	'',	1),
(2,	1,	'2017-04-25 08:39:20',	'2017-04-25 08:39:20',	'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://localhost:51791/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!\r\n\r\n[metaslider id=10]\r\n\r\n&nbsp;\r\n\r\n<iframe src=\"https://worldview.earthdata.nasa.gov/?p=geographic&amp;l=VIIRS_SNPP_CorrectedReflectance_TrueColor(hidden),MODIS_Aqua_CorrectedReflectance_TrueColor(hidden),MODIS_Terra_CorrectedReflectance_TrueColor,Reference_Labels(hidden),Reference_Features(hidden),Coastlines&amp;t=2017-04-25&amp;z=3&amp;v=-83.109375,-39.09375,108.984375,54\" width=\"500\" height=\"500\"></iframe>',	'Sample Page',	'',	'publish',	'closed',	'open',	'',	'sample-page',	'',	'',	'2017-04-25 11:10:24',	'2017-04-25 11:10:24',	'',	0,	'http://localhost:51791/?page_id=2',	0,	'page',	'',	0),
